() => {
  login.run(() => {
    storeValue('username', login.data.username, true);
    storeValue('access_token', login.data.accessToken, true);
    storeValue('api_server', 'https://preprod-az.gonuclei.com/api');
    storeValue('slack_alert_activity', undefined);
    storeValue('slack_alert_message', undefined);
    storeValue('slack_delete_message', 'Deleted the file name : \'<filename>\'');
    navigateTo('Dashboard', {}, 'SAME_WINDOW');
  }, () => showAlert('Invalid Credentials', 'error'));
}

